import React from "react";
import Table_flesh_child from "./Table_flesh_child";

function Table_center(props){
    console.log("Table_center")
    return(
    <div className="div_box_center">  
        <div style={{clipPath:"polygon(50% 50%, 0% 100%, 100% 100%)"}} className="box_center bg-success"> 
            <Table_flesh_child calcule_flesh={props.calcule_flesh} boy_flesh_p={props.boy_flesh_p} boy_flesh_s={props.boy_flesh_s} num_flesh={'w_'+8} p_yakliki={props.p_yakliki} s_yakliki={props.s_yakliki} num={props.flesh_num} boy_p={props.boy_p} child={props.child} />
        </div>
        <div style={{clipPath:"polygon(50% 50%, 0% 100%, 0 0)"}} className="box_center bg-danger"> 
        
        </div>
        <div style={{clipPath:"polygon(50% 50%, 100% 0, 0 0)"}} className=" box_center bg-primary"> 
            <Table_flesh_child calcule_flesh={props.calcule_flesh} boy_flesh_p={props.boy_flesh_p} boy_flesh_s={props.boy_flesh_s} num_flesh={'p_'+8} p_yakliki={props.p_yakliki} s_yakliki={props.s_yakliki} num={props.flesh_num} boy_p={props.boy_p} child={props.child} />
        </div>
        <div style={{clipPath:"polygon(50% 50%, 100% 0, 100% 100%)"}} className="bg-warning box_center"> 
        
        </div>
    </div>
    )
}

export default React.memo(Table_center) ;
